import logo from './logo.svg';
import './App.css';
import SimpleMenu from './Menu';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Welcome to Roro Zoo
          <SimpleMenu></SimpleMenu>
        </p>
      </header>
    </div>
  );
}

export default App;
